import React from "react";
import { Drawer, withStyles } from "@material-ui/core";
import List from "./List/List";

const styles = {
  drawer: {
    width: 250,
    height: "calc(100% - 64px)",
    marginTop: 64
  }
};

const DrawerComponent = ({
  classes,
  filterStatus,
  filterToggle,
  toggleRatings,
  toggleRatingsStatus,
  handleChange,
  reset
}) => {
  return (
    <Drawer
      anchor="right"
      variant="persistent"
      open={filterStatus}
      onClose={filterToggle}
    >
      <div tabIndex={0} role="button" className={classes.drawer}>
        <List
          toggleRatingsStatus={toggleRatingsStatus}
          toggleRatings={toggleRatings}
          handleChange={handleChange}
          discTypeSelector={discTypeSelector}
          manufactureSelector={manufactureSelector}
          reset={reset}
        />
      </div>
    </Drawer>
  );
};

export default withStyles(styles)(DrawerComponent);
